import React from 'react'
import "./styles.css"
import Listİtem from './Listİtem';


function List({toDoList}) {
    return (
        <ul className="todo-list">
            {
                toDoList.map((text,index)=>(<Listİtem text={text} key={index}/>))
            }
        </ul>
    )
}

export default List
